import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/header" element={<Header />} />
          <Route path="/addPage" element={<AddAnnouncement />}/>
          <Route path="/selectItem" element={<SelectedItem />} />
          <Route path="/profile" element={<Profile />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
